name: nrh

model_type: segmented_regression

segmentation_col: building_type_id

fit_filters:
- non_residential_sqft > 0
- year_built > 1700
- stories > 0
- sqft_price_nonres > 0
- 21 <= building_type_id <= 71

predict_filters:
- non_residential_sqft > 0
- 21 <= building_type_id <= 71

